import { Button, TextField } from "@mui/material";
// import { FormLabel, TextField } from "@mui/material";
import { Box } from "@mui/system";

import "./Book/Book.css";
import React from "react";


const AddBook = () => {
  return (
    
    <form>

      <Box 
      display="flex" 
      flexDirection="column" 
      justifyContent={'center'}
      maxWidth={700} 
      sx= {{mt:'100px'}}
      alignContent = {"center"}
      alignSelf = "center"
      marginLeft = {"auto"}
      marginRight = "auto"
      // marginTop={10}
      >
      
      
        {/* <FormLabel>Name </FormLabel> */}
        <TextField margin="normal"  name="name" label="Name" />
        {/* <FormLabel>Author</FormLabel> */}
        <TextField margin="normal" name="author" label="Author"/>
        {/* <FormLabel>Description</FormLabel> */}
        <TextField margin="normal" name="description" label="Description" />
        {/* <FormLabel>Price</FormLabel> */}
        <TextField type = "number" margin="normal" name="price" label="Price"/>
       
       <Button vatiant = "contained" type = 'submit'>Add Book</Button>
      </Box>


    </form>
    
  );
};

export default AddBook;
